import React, { Component } from 'react'

export class Test2 extends Component {
    state ={

        value : 'Defalt'
    }

    change =(event) =>{
        this.setState({
            value: event.target.value
        })
    }

    render() {
        return (
            <div>

                <input type="text" onChange={this.change} />
                <p>{this.state.value}</p>
            </div>
        )
    }
}

export default Test2
